import React from "react";
import {Button,Collapse} from 'reactstrap'

const DaySlot = () => {
  return (
    <div>
      <Button
        block
        color="success"
        onClick={toggle}
        style={{ marginBottom: "1rem", marginTop: "1rem" }}
      >
        {getDays(date)}
      </Button>
      <Collapse isOpen={isOpen}>
        10-12 12-14 14-16 16-18 18-20 20-22 22-00
      </Collapse>
    </div>
  );
};

export default DaySlot;
